import React from "react";
import SearchBar from "./SearchBar";
import { Link } from "react-router-dom";

export default function Nav({onSearch}) {
   return (
      <div>
        <SearchBar onSearch= {onSearch}/>
        <hr />
        <button>
        <Link to="/home">Home</Link>
        </button>
        <button>
        <Link to="/home">Home</Link>
        </button>
        <hr />
      </div>
   );
}
